import { HeaderStyled } from "./Header.styled";
import { Logo } from "../Logo/Logo";
import { IoMenu } from "react-icons/io5";

export const Header = ({ children }) => {
  return (
    <HeaderStyled>
      <Logo></Logo>
      <IoMenu fill="#333D4B"/>
    </HeaderStyled>
  );
};
